import React, { Component } from 'react';

class Details extends Component {
    render(){
        const {name, pictureUrl} = this.props
        return (
            <>
            <img src={pictureUrl} alt="Actor"></img>,
            <h3>{name}</h3>
            </>
        )
    }
}

export default Details
